export declare const START_UPLOAD_QUERY = "mutation StartUpload($namespace: FileStorageNamespace!, $startUploadReqInput: StartUploadReqInput!) {\n    startUpload(\n      namespace: $namespace,\n      startUploadReqInput: $startUploadReqInput\n    ) {\n      file_name\n      file_path\n      content_type\n      method\n      namespace\n      operation\n      size\n      tags\n      upload\n      {\n        expiry\n        url\n      }\n    }\n  }";
export declare const COMPLETE_UPLOAD_QUERY = "mutation CompleteUpload($namespace: FileStorageNamespace!, $completeUploadReqInput: CompleteUploadReqInput!) {\n    completeUpload(\n        namespace: $namespace\n        completeUploadReqInput: $completeUploadReqInput\n    ) {\n        file_name\n        file_path\n        content_type\n        namespace\n        size\n        tags\n        cdn {\n            url\n            absolute_url\n            relative_url\n        }\n        upload {\n            expiry\n            url\n        }\n    }\n}";
